import React, { useState } from 'react';
import './SessionBooking.css';

const SessionBooking = () => {
  const [selectedDate, setSelectedDate] = useState('');
  const [selectedTime, setSelectedTime] = useState('');
  const [sessionType, setSessionType] = useState('video');

  const availableDates = [
    '2024-01-15', '2024-01-16', '2024-01-17', '2024-01-18'
  ];

  const availableTimes = [
    '9:00 AM', '10:00 AM', '11:00 AM', '2:00 PM', '3:00 PM', '4:00 PM'
  ];

  const sessionTypes = [
    { id: 'video', name: 'Video Call', icon: 'ðŸ“¹', description: 'Face-to-face online meeting' },
    { id: 'phone', name: 'Phone Call', icon: 'ðŸ“ž', description: 'Audio conversation' },
    { id: 'in-person', name: 'In-Person', icon: 'ðŸ‘¥', description: 'Meet at office location' }
  ];

  const handleBooking = () => {
    if (!selectedDate || !selectedTime) {
      alert('Please select both date and time');
      return;
    }
    alert(`Session booked for ${selectedDate} at ${selectedTime} (${sessionType})`);
  };

  return (
    <div className="session-booking">
      <h3>Schedule Your Session</h3>
      
      {/* Session Type Selection */}
      <div className="booking-section">
        <h4>Session Type</h4>
        <div className="session-type-grid">
          {sessionTypes.map(type => (
            <div 
              key={type.id}
              className={`session-type-card ${sessionType === type.id ? 'selected' : ''}`}
              onClick={() => setSessionType(type.id)}
            >
              <div className="type-icon">{type.icon}</div>
              <div className="type-info">
                <h5>{type.name}</h5>
                <p>{type.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Date Selection */}
      <div className="booking-section">
        <h4>Select Date</h4>
        <div className="date-grid">
          {availableDates.map(date => (
            <button
              key={date}
              className={`date-btn ${selectedDate === date ? 'selected' : ''}`}
              onClick={() => setSelectedDate(date)}
            >
              {new Date(date).toLocaleDateString('en-US', { 
                weekday: 'short', 
                month: 'short', 
                day: 'numeric' 
              })}
            </button>
          ))}
        </div>
      </div>

      {/* Time Selection */}
      <div className="booking-section">
        <h4>Select Time</h4>
        <div className="time-grid">
          {availableTimes.map(time => (
            <button
              key={time}
              className={`time-btn ${selectedTime === time ? 'selected' : ''}`}
              onClick={() => setSelectedTime(time)}
            >
              {time}
            </button>
          ))}
        </div>
      </div>

      {/* Booking Summary */}
      {(selectedDate || selectedTime) && (
        <div className="booking-summary">
          <h4>Booking Summary</h4>
          <div className="summary-details">
            <p><strong>Date:</strong> {selectedDate ? new Date(selectedDate).toDateString() : 'Not selected'}</p>
            <p><strong>Time:</strong> {selectedTime || 'Not selected'}</p>
            <p><strong>Type:</strong> {sessionTypes.find(t => t.id === sessionType)?.name}</p>
          </div>
        </div>
      )}

      {/* Action Buttons */}
      <div className="booking-actions">
        <button 
          className="confirm-btn"
          onClick={handleBooking}
          disabled={!selectedDate || !selectedTime}
        >
          Confirm Booking
        </button>
        <button className="cancel-btn">
          Cancel
        </button>
      </div>
    </div>
  );
};

export default SessionBooking;
